/**
 * @description 首页
 */
import React from 'react';
import BaseFormUI from '@/components/BaseFormUI';
import { Button, Card } from 'antd-mobile';
import './index.less';

const Home = () => {
  return (
    <div className='home'>
      <Card title='Default size card'>
        <Button type='primary'>编辑</Button>
      </Card>
    </div>
  );
};

export default Home;
